import { useRef, useEffect } from 'react';

import { Game } from '../game/Game';

function RoomGame() {
    const ref = useRef(null);

    // Create our application
    const game = new Game({ ref:ref });

    useEffect(() => {
        // On load start the game
        game.start();

        // On unload end the game
        return () => {
            game.end();
        };
    }, []);

    return (
        <div ref={ref} />
    );
}

export default RoomGame;
